import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import Categories from './pages/Categories';
import Contact from './pages/Contact';
import Account from './pages/Account';
import Navbar from './components/Navbar';
import HomePage from './pages';
import Footer from './components/Footer';
import Login from './components/Login';
import Register from './components/Register';
import { AuthProvider } from './auth/AuthContext';
import MenuOne from './components/menuOne';
import MenuTwo from './components/menuTwo';
import MenuThree from './components/menuThree';
import MenuFour from './components/menuFour';

function App() {

  document.addEventListener("copy", function (e) {
    e.preventDefault();
    e.clipboardData.setData("text/plain", "Drink Coffee! but dont' copy :)");
  });





  return (
    <BrowserRouter>
    <AuthProvider>
    <Navbar />
    <Routes>
    <Route path='/' element={<HomePage />}></Route>
    <Route path='/home' element={<Home />}>
    <Route path='/menu-one' element={<MenuOne />} />
    <Route path='/menu-two' element={<MenuTwo />} />
    <Route path='/menu-three' element={<MenuThree />} />
    <Route path='/menu-four' element={<MenuFour />} />
    <Route path='/menu-five' element={<MenuFive />} />


    </Route>
    <Route path='/categories' element={<Categories />}></Route>
    <Route path='/contact' element={<Contact />}></Route>
    <Route path='/account' element={<Account />}>
      <Route path='/account/login' element={<Login />}></Route>
      <Route path='/account/register' element={<Register />}></Route>
    </Route>

    </Routes>
    <Footer />
    </AuthProvider>
    </BrowserRouter>
  );
}

export default App;
